import React, { useEffect, useState } from "react";
import { Button, StyleSheet, Text, View ,FlatList,TouchableOpacity } from "react-native";
import vjezbeServer from '../src/services/vjezbe'

const Kategorije = (props) => {

const [vjezbe, postaviVjezbe]=useState([])

  useEffect( ()=>{
    console.log("effect hook");
    vjezbeServer.dohvatiSve().then((response) => {
      console.log("Podaci ucitani");
      postaviVjezbe(response.data)
    })
  })
  const kategorije = [...new Set(vjezbe.map(v => v.kategorija))]
  
  const renderGrid = (kategorije) => {
    return (
      <TouchableOpacity style={stil.gridElement}
      onPress={props.navigation.navigate("JednaKategorija",{
        imeKategorije: vjezbe.item.kategorija
      })}>
        <View >
        <Text>{kategorije.item}</Text>
      </View>
      </TouchableOpacity>
    )
  }
  return (
    <View style={stil.ekran}>    
      <FlatList data={kategorije} renderItem={renderGrid} />
     
      <Button title= 'Odjava' 
  onPress={()=> { props.navigation.navigate('Login') }}/>
    </View>
  );
};

Kategorije.navigationOptions= {
  headerTitle:"Izaberi kategoriju",
  headerStyle: {
    backgroundColor: '#FE2F57'
  },
  headerTintColor: 'white'
}
const stil = StyleSheet.create({
  gridElement: {
    flex: 1,
    margin: 25,
    height: 200,
    borderColor:'black',
    borderWidth:1
  },
  container: {
    flex: 1,
    justifyContent: 'center',
    backgroundColor: '#ecf0f1',
  },
  video: {
    alignSelf: 'center',
    width: 320,
    height: 200,
  },
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default Kategorije;
